  field_description:
    -
      value: "<h3>Why contribute?</h3>\r\n\r\n<p>The more that people contribute, the stronger Drupal becomes. The more polished and refined the project is, the more job security we all have.</p>\r\n\r\n<h3>Why sprint?</h3>\r\n\r\n<p>It’s an excellent opportunity to connect with other contributors, help collaborate and brainstorm, and move the Drupal project forward. Contributing is a fantastic way to receive feedback and build skills while learning from those more experienced.</p>\r\n\r\n<h3>Not a coder or new to tech?</h3>\r\n\r\n<p>That’s great! It’s your turn to shine.</p>\r\n\r\n<p>Not everyone who works on Drupal is a developer: Project Managers, Customer Service, and those who hold non-technical roles can all give back to the community. Code is important, but so are all the other parts.</p>\r\n\r\n<h3>We got you covered!</h3>\r\n\r\n<p>There will be mentors available for those who need a little help to get started.</p>\r\n\r\n<p>We will make sure you stay caffeinated, fed, and hydrated.</p>\r\n"
